	this.frame_0 = function() {
		this.stop();
		this.gotoAndStop(1);
		var st = this;
		var NewImage_Lib = new lib.newImage();
		var ThankImage_Lib = new lib.thankImage();
		var WantImage_Lib = new lib.wantImage();
		var FinishedImage_Lib = new lib.finishedImage();
		var ComeImage_Lib = new lib.comeImage();
		var HelpImage_Lib = new lib.helpImage();
		var NeighboursImage_Lib = new lib.neighboursImage();
		var NewFriendsImage_Lib = new lib.newFriendsImage();
		var line = new createjs.Shape();
		var flag = false;
		var index = 0;
		line.mouseEnabled = false;
		stage.addChild(line);
		createjs.Touch.enable(stage);
		stage.mouseChildren = true;
		
		var Word = [st.New_Word, st.Thank_Word, st.Want_Word, st.Finished_Word, st.Come_Word, st.Help_Word, st.Neighbours_Word, st.NewFriends_Word];
		var Image = [NewImage_Lib, ThankImage_Lib, WantImage_Lib, FinishedImage_Lib, ComeImage_Lib, HelpImage_Lib, NeighboursImage_Lib, NewFriendsImage_Lib];
		var Shade = [st.Neww, st.Thank, st.Want, st.Finished, st.Come, st.Help, st.Neighbours, st.NewFriends]
		
		for (i = 0; i < Word.length; i++) {
			Word[i].alpha = 0;
			//Image[i].alpha = 0;
		}
		
		st.Clear_Btn.addEventListener('click', clearDrawing);
		st.Next_Btn.addEventListener('click', goToNext);
		st.Back_Btn.addEventListener('click', goToPrevious);
		st.addEventListener('mousedown', setPosition);
		st.coin.addEventListener('pressmove', scratch);
		
		function setPosition(target) {
			pos = stage.globalToLocal(stage.mouseX, stage.mouseY);
			st.setChildIndex(st.coin, st.getNumChildren() - 1);
			st.setChildIndex(Shade[index], st.getNumChildren() - 2);
		}
		
		function scratch(evt) {
			st.addChild(Image[index]);
			if (Image[index] == ComeImage_Lib) {
				Image[index].x = 706.35;
				Image[index].y = 284.2;
			} else if (Image[index] == NeighboursImage_Lib) {
				Image[index].x = 695.5;
				Image[index].y = 285.5;
			} else {
				Image[index].x = 707.35;
				Image[index].y = 313.75;
			}
			createjs.Touch.enable(stage);
			var p = st.globalToLocal(evt.stageX, evt.stageY);
			st.coin.x = p.x;
			st.coin.y = p.y;
			setPosition();
			line.graphics.drawCircle(pos.x, pos.y, 55).moveTo(pos.x, pos.y);
			handleTick();
			//make shape mask
			Image[index].mask = line;
			Image[index].alpha = 1;
			stage.update();
			var pc = Image[index].globalToLocal(stage.mouseX, stage.mouseY);
			if (!flag) {
				if (Image[index].hitTest(pc.x, pc.y)) {
					flag = true;
					Word[index].alpha = 1;
					Word[index].play();
					st.Scratch_Word.alpha = 0;
				}
			}
		}
		
		function goToNext() {
			st.removeChild(Image[index]);
			st.gotoAndStop(st.currentFrame + 1);
			index++;
			st.removeEventListener('click', goToNext);
			clearDrawing()
		}
		
		function goToPrevious() {
			st.removeChild(Image[index]);
			st.gotoAndStop(st.currentFrame - 1);
			index--;
			st.removeEventListener('click', goToPrevious);
			clearDrawing();
		}
		
		function clearDrawing() {
			line.graphics.clear();
			flag = false;
			Word[index].alpha = 0;
			st.Scratch_Word.alpha = 1;
			Image[index].alpha = 0;
		}
	}

